import * as React from 'react';
import { styled } from '../../stitches.config';

interface GameHeaderProps {
	showInfo: boolean;
	stage: number;
	time: number;
	score: number;
}

const GameHeader: React.FC<GameHeaderProps> = ({
	showInfo,
	stage,
	time,
	score,
}) => {
	return (
		<Header>
			<Typo>스테이지 : {stage}</Typo>
			<Typo>남은 시간 : {time}</Typo>
			<Typo>점수 : {score}</Typo>
		</Header>
	);
};

export default GameHeader;

const Header = styled('div', {
	width: 320,
	display: 'flex',
	flexDirection: 'column',
	marginBottom: 16,
});

const Typo = styled('span', {
	fontSize: 16,
	lineHeight: 1.4,
	fontWeight: 700,
	color: '#333333',
});
